import React from "react";
import { Map, GoogleApiWrapper } from 'google-maps-react';

const Maps = () =>{
    return(
        <div className="map-container">
           <h1>maps</h1>
           <Map 
                google={this.props.google}
                zoom={8}
                style={mapStyles}
                initialCenter={{ lat: 47.444, lng: -122.176}}
            />
        </div>    
    );
}

export default Maps;
